    //         updateOnnOff('off')
    //         return;

    //         case('off'):
    //         updateOnnOff('on')
    //         return;
    //     }

    // }

    switch(OnOff){

    case('on'): 
    
        return <React.Fragment>
        <span id='Closed_Toggler_Button' onClick={updateOnnOff('off')}>
            Open Filter
        </span>
        </React.Fragment>
    
    case('off'):

        return <React.Fragment>
        <span id='Closed_Toggler_Button'>
            Close Filter
        </span>
        </React.Fragment>

    }
}

export default Closed_Toggler_Button;
